import { setFileScope, endFileScope } from "@vanilla-extract/css/fileScope";
import { style } from "@vanilla-extract/css";
setFileScope("src/lib/components/HiddenVisually/HiddenVisually.css.ts?used", "braid-design-system");
const root = style({
  width: 1,
  height: 1,
  clip: "rect(1px, 1px, 1px, 1px)",
  whiteSpace: "nowrap"
}, "root");
endFileScope();
export {
  root
};
